import { Get_TShirts} from "../Services/ApiConsumer"
import { useState, useEffect } from "react"

export default function ShowStock()
{
    const [data, setData] = useState([])
    const [loading, setLoading] = useState(true)
    const [error, setError] = useState(null)

    useEffect(() =>{
        async function fetchData() 
        {
            try{
                const data = await Get_TShirts()
                setData(data)
            }
            catch(error){
                setError("Não foi possivel trazer os dados")
            }
            finally{
                setLoading(false)
            }
        }

        fetchData()
    },[])

    if(loading == true) return <h2>loading...</h2>
    if(error) return <h2>{error}</h2>
    if(data.length > 0)
    {
        return(
            <>
                {data.map(shirt => {
                    <div>
                        {shirt.Name} - {shirt.Size}
                    </div>
                })}
            </>
        )
    }
    return <>Ola mundo</>

}
